export async function getServerSideProps({params: {category_hiffen_name}}) {

    //const res = await getData(`categorias/${category_hiffen_name}`);
    const res = {category: category_hiffen_name}

    return {
      props: { category: res.category}, // will be passed to the page component as props
    }
  }
